type Corps struct {
	ResultCode        string `json:"resultCode"`
	ResultDescription string `json:"resultDescription"`
	Data              struct {
		ID               int    `json:"id"`
		SnowflakeID      string `json:"snowflakeId"`
		Name             string `json:"name"`
		ToProduction     bool   `json:"toProduction"`
		ProductionStatus string `json:"productionStatus"`
		CorpList         []struct {
			ID            int    `json:"id"`
			Address       string `json:"address"`
			Name          string `json:"name"`
			CorpType      int    `json:"corpType"`
			CityID        int    `json:"cityId"`
			Namespace     string `json:"namespace"`
			CorpTypeLabel string `json:"corpTypeLabel"`
		} `json:"corpList"`
	} `json:"data"`
}

func (c *Corps) Namespaces() []string {
	var namespaces []string
	for _, corp := range c.Data.CorpList {
		namespaces = append(namespaces, corp.Namespace)
	}
	return namespaces
}

func (c *Corps) NamespacesJson() []string {
	var namespaces []string
	for _, corp := range c.Data.CorpList {
		namespaces = append(namespaces, fmt.Sprintf(`{"corpNamespace": "%s","themeID": 2},`, corp.Namespace))
	}
	fmt.Println("len(namespaces):", len(namespaces))
	return namespaces
}

